insert into accounts(gen_id) select distinct REPLACE(REPLACE(REPLACE(REPLACE(gen_id, CHAR(9), ''), CHAR(10), ''), CHAR(12), ''), CHAR(13), '') from stg_accounts where REPLACE(REPLACE(REPLACE(REPLACE(gen_id, CHAR(9), ''), CHAR(10), ''), CHAR(12), ''), CHAR(13), '') not in (select gen_id from accounts);
